///         <ul>
///           <li>
///             ⚠️ Do not call <code>completionHandler</code> in your implementation
///           </li>
///         </ul>
///       </li>
///     </ul>
///   </li>
///   <li>
///     <code>false</code>:
///     <ul>
///       <li>
///         Invalid Braze remote notification (e.g. in-house notification)
///       </li>
///       <li>
///         Braze <em>will not</em> call <code>completionHandler</code> automatically
///         <ul>
///           <li>
